export default function Summary(array) {

    var dadosArquivados = JSON.parse(sessionStorage.getItem('chave'));
    document.getElementById('list').innerHTML = <li>${dadosArquivados}</li>

    function elements() {
        alert(dadosArquivados)
    }
    return (
        <div>
            <div className="flex justify-center">
                <form className="pt-12" method="form" action='/summary' onSubmit={elements}>
                    <div className='flex justify-center text-4xl text-white mb-10'>
                        Resumo
                    </div>
                    <ul id='list'>
                    </ul>
                    <div className="flex justify-end text-white pt-4">
                        <input type="submit" value="Submit" className="border rounded-md p-1"></input>
                    </div>
                </form>
            </div>
        </div>
    )
}
